import Link from 'next/link';

const HomePage = () => {
    return (
        <div className='container'>
            <div className='topbar'>
                <div className='logo-container'>
                    <Link href='/'>
                        <a className='link'> STOCK </a>
                    </Link>
                </div>
                <div className='logo-container'>
                    <div>
                        <Link href='.products'>
                            Products
                        </Link>
                    </div>
                    <div>
                        <Link href='.manage'>
                            Manage
                        </Link>
                    </div>
                    <div>
                        <Link href='.profile'>
                            Profile
                        </Link></div>
                </div>
            </div>

            <style jsx global>{`
            @font-face{
                font-family: Roboto;
                src:url(/static/font/Serithai-Regular.ttf);
                font-weight: 400;
            }
               body{
                        magin:0;
                        font-family:'Roboto';
                }
                `}</style>
            <style jsx>{`
                .topbar{
                    display : flex;
                    //flex-direction: column;
                    justify-content:space-between;
                    align-item: center;
                    height: 32px;
                    padding: 0 40px;
                }   
                .menu-container{
                    display :flex;
                    //flex-direction:row;
                }
                .menu-container div{
                    margin-left: 5px;
                }
                .link{
                    text-direction:none;
                    culor: back;
                }      
            `}</style>
        </div>
    )
}

export default HomePage;
